import React, { Component } from 'react';
import axios from 'axios';
import {
	SpotifyApiContext,
	SpotifyApiAxiosContex,
	Search
} from 'react-spotify-api';

class Rhythm extends Component {
	render() {
		return (
			<SpotifyApiAxiosContext.Provider value={axios}>
				<SpotifyApiContext.Provider value={`58b9c4063c904cda87af80186a732f01`}>
					<Search query='never let you go'></Search>
				</SpotifyApiContext.Provider>
			</SpotifyApiAxiosContext.Provider>
		);
	}
}

export default Rhythm;
